INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (4, 1, 8, 3.18, 10, 7, 11300101, "フフ、全問正解よ！\nちゃんと勉強してるみたいで\n感心だわ♪", 1, 1, 3001, 10, "vo_minigame_1012_result_1000");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (10, 1, 7, 3.33, 10, 8, 11300102, "すごいじゃない…全問正解よ！\nま、当然といや当然よね～\nだってあたしが\n教えてやってんだから♪", 1, 1, 3001, 10, "vo_minigame_1012_result_1001");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (10, 1, 1, 5.41, 10, 8, 11300103, "全問正解！　パチパチパチ～♪\nこの難易度はもう完璧じゃない？\n次はもっと難しい問題に挑戦よ！\nあんたならできるって！", 1, 1, 3001, 10, "vo_minigame_1012_result_1002");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (10, 2, 8, 8.11, 10, 5, 11300104, "へえ…難しい問題を選んだのに\n全問正解できてるじゃない！！\nちょっとあんたすごすぎだわ…！\nパーフェクトよパーフェクト！", 1, 1, 3001, 10, "vo_minigame_1012_result_1003");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (0, 2, 5, 1.31, 10, 10, 11300105, "まる…まる…全部まる！\n難しい問題なのに全問正解よ…！\n驚いた…あんたいつの間に、\nこんなに勉強してたのよ！", 1, 1, 3001, 10, "vo_minigame_1012_result_1004");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (0, 2, 8, 4.93, 10, 9, 11300106, "ここまで完璧に正解されちゃうと\nちょっと悔しいわね…！\nけど素直に褒めてやるわ！\nえらい、えらい、えら～い！", 1, 1, 3001, 10, "vo_minigame_1012_result_1005");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (4, 3, 8, 2.99, 10, 5, 11300107, "すごい…あんたパーフェクトよ！\nこのままいけば次の試験、\n学年一位も夢じゃないかもね！\n楽しみだわ～♪", 1, 1, 3001, 10, "vo_minigame_1012_result_1006");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (4, 3, 7, 8.37, 10, 8, 11300108, "満点よ！　フフ、もうあんたに\n教えることはなにもないわ…！\n逆にあたしがあんたに教わりたい\nくらいよ！　…ね、先生♪", 1, 1, 3001, 10, "vo_minigame_1012_result_1007");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (8, 3, 5, 5.32, 10, 7, 11300109, "全・問・正・解！\n超難問揃いなのにすごいわね…！\nもしかしてだけど、\nあんたって天才！？", 1, 1, 3001, 10, "vo_minigame_1012_result_1008");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (4, 1, 1, 4.77, 7, 7, 11300110, "お、かなりいい点数ね～！\nあたしも教えがいがあるわ♪\nさ、まだまだ勉強するわよ！", 1, 1, 3001, 9, "vo_minigame_1012_result_1009");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (4, 1, 7, 2.97, 7, 8, 11300111, "うん、いい感じで点取れてるわ！\nこの調子で次は、\n満点を見せてほしいわね！", 1, 1, 3001, 9, "vo_minigame_1012_result_1010");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (0, 1, 1, 3.47, 7, 5, 11300112, "あ～惜しい！\nもうちょっとで満点じゃない！\n次はパーフェクトいけるわ！\n頑張りましょ！", 1, 1, 3001, 9, "vo_minigame_1012_result_1011");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (4, 2, 7, 5.32, 7, 8, 11300113, "すごい、かなりできてるわよ！\n難しい問題なのにやるじゃない！\nあとは目指せ、満点ね！", 1, 1, 3001, 9, "vo_minigame_1012_result_1012");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (10, 2, 7, 6.49, 7, 8, 11300114, "うん、かなりいい感じよ！\nあんたには赤点の心配なんて\nまーったくなさそうね♪\nでも勉強はやめさせないけど！", 1, 1, 3001, 9, "vo_minigame_1012_result_1013");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (0, 2, 1, 3.56, 7, 5, 11300115, "あーあとちょっとで\n全問正解だったのに！\n難しい問題だけどあんたなら\n次は満点狙えるわ！", 1, 1, 3001, 9, "vo_minigame_1012_result_1014");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (10, 3, 1, 5.67, 7, 8, 11300116, "うん、ほとんど正解よ！\nこんな難しい問題なのに、\nすごいじゃない！\nやっぱりあんた只者じゃないわ！", 1, 1, 3001, 9, "vo_minigame_1012_result_1015");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (10, 3, 1, 2.85, 7, 7, 11300117, "着実に成長してるって感じね？\nあんたならこの難問でも、\nいつか満点取れちゃうかも…！", 1, 1, 3001, 9, "vo_minigame_1012_result_1016");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (0, 3, 1, 3.88, 7, 5, 11300118, "うわー惜しいわね！\nもうちょっとで満点よ？\nま、あたしでも悩む難問だから、\nこの点数は胸を張っていいわ！", 1, 1, 3001, 9, "vo_minigame_1012_result_1017");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (0, 1, 1, 4.12, 4, 3, 11300119, "正解率は半分くらいか～\n悪くはないんだけど、あんたなら\nこんなもんじゃないでしょ？", 1, 1, 3001, 6, "vo_minigame_1012_result_1018");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (0, 1, 1, 4.34, 4, 9, 11300120, "んーはっきり言っちゃうと\n中途半端な点数ね…\nまあいいわ！こっからガンガン\n点数上げていくわよ！", 1, 1, 3001, 6, "vo_minigame_1012_result_1019");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (0, 1, 1, 3.15, 4, 3, 11300121, "う～ん、正直物足りない点数ね！\nあんたには期待してんだから、\nもっと頑張んなさい！", 1, 1, 3001, 6, "vo_minigame_1012_result_1020");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (0, 2, 1, 5.3, 4, 9, 11300122, "半分くらいの正解率か\n難しい問題だから仕方ないわね…\nでもあんたはもっとできる！\nだってあたしがついてんのよ！", 1, 1, 3001, 6, "vo_minigame_1012_result_1021");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (0, 2, 1, 2.55, 4, 8, 11300123, "うん、そこそこできんじゃない！\n頑張って勉強して\nさらに上を目指しましょ！", 1, 1, 3001, 6, "vo_minigame_1012_result_1022");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (0, 2, 7, 4.19, 4, 1, 11300124, "難問なのにこの正解率は\nよくやってる方よね！\nでもこんなところで\n満足してんじゃないわよ！？", 1, 1, 3001, 6, "vo_minigame_1012_result_1023");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (0, 3, 1, 3.43, 4, 7, 11300125, "難問なのに半分くらい正解\nできてんじゃない♪\nこの調子でもっと学力\n上げていきましょ！", 1, 1, 3001, 6, "vo_minigame_1012_result_1024");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (0, 3, 1, 0.0, 4, 1, 11300126, "よし、平均点ってとこね！\nちゃんと勉強してるみたいで\n安心したわ～♪", 1, 1, 3001, 6, "vo_minigame_1012_result_1025");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (0, 3, 7, 3.72, 4, 8, 11300127, "難問揃いでこの正解率は\n大したもんよ！\nま、もっといい点取りたいんなら\n勉強、付き合ったげるわ！", 1, 1, 3001, 6, "vo_minigame_1012_result_1026");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (1, 1, 2, 3.5, 1, 3, 11300128, "なるほど…\nこれは教えがいがあるわね\nビシバシ鍛えてやるから\n覚悟しなさい！", 1, 1, 3001, 3, "vo_minigame_1012_result_1027");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (1, 1, 2, 3.25, 1, 4, 11300129, "ちょっとあんた、\n全然できてないじゃない！\n…まさかこれが本気だなんて\n言わないわよね～？", 1, 1, 3001, 3, "vo_minigame_1012_result_1028");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (0, 1, 2, 4.62, 1, 3, 11300130, "うーん……適当に答えても\nこれくらい正解できるわよ？\nちょっと本腰入れて\n教えないとね……！", 1, 1, 3001, 3, "vo_minigame_1012_result_1029");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (0, 2, 1, 4.5, 1, 9, 11300131, "…ま、まあこの問題は\nあんたには難しすぎたのかもね\nちょっとずつでいいから、\nレベルアップしていきましょ！", 1, 1, 3001, 3, "vo_minigame_1012_result_1030");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (9, 2, 3, 0.01, 1, 3, 11300132, "んー結構ミスっちゃってるわね…\nこのまま続けるのもいいけど、\n簡単な問題からやり直すのも\nありかもよ～？", 1, 1, 3001, 3, "vo_minigame_1012_result_1031");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (9, 2, 9, 0.01, 1, 9, 11300133, "あらら、あんたにはちょっと\n難しすぎたかしら…？\nもう一回やり直しましょうか！", 1, 1, 3001, 3, "vo_minigame_1012_result_1032");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (6, 3, 3, 0.01, 1, 3, 11300134, "うーん、残念な結果ね…\n超難問だから仕方ないけど\n無理せず簡単な問題から挑戦\nしてもいいかもよ？", 1, 1, 3001, 3, "vo_minigame_1012_result_1033");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (0, 3, 9, 2.97, 1, 3, 11300135, "正解率はかなり悪いわね…\nまあ難しい問題だもんね…！\nそのチャレンジ精神は買うわ！", 1, 1, 3001, 3, "vo_minigame_1012_result_1034");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (0, 3, 1, 3.1, 1, 3, 11300136, "なんとか０点は免れたわね…\n難問揃いだけど、\nもっと頑張っていきましょ！", 1, 1, 3001, 3, "vo_minigame_1012_result_1035");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (1, 1, 2, 4.31, 0, 6, 11300137, "…あんたさ、０点なんて\n逆に取るの難しいわよ！？\nまさか狙ったわけじゃ\nないでしょーね～！？", 1, 1, 3001, 0, "vo_minigame_1012_result_1036");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (1, 1, 2, 0.1, 0, 2, 11300138, "０点って…\nあんたふざけてんの！？\nちゃんとやらないなら\n電撃魔法くらわせるわよ！？", 1, 1, 3001, 0, "vo_minigame_1012_result_1037");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (9, 1, 3, 4.23, 0, 9, 11300139, "もしかしたらあんたは\n勉強向いてないのかもね…\n…勉強だけがすべてじゃないわ\n違うとこで頑張りましょ！", 1, 1, 3001, 0, "vo_minigame_1012_result_1038");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (0, 2, 2, 4.38, 0, 3, 11300140, "怒んないから正直に言って？\n…ふざけて答えたでしょ？\nほら、正直に\n言・い・な・さ・い？", 1, 1, 3001, 0, "vo_minigame_1012_result_1039");
