INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (0, 1, 7, 4.24, 5, 1, 12300146, "ふ～ん、まあまあの出来だわ\n悪くはないんだけど…あんたには\nもっともっと期待してるわ～", 1, 2, 3001, 9, "vo_minigame_1012_result_1078");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (0, 1, 1, 4.74, 5, 7, 12300147, "うん、頑張ったけど…\n正直もっと正解できるかもね～？\nこんなのあんたには通過点！\nさらに良い点目指してみない？", 1, 2, 3001, 9, "vo_minigame_1012_result_1079");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (0, 1, 1, 0.0, 5, 1, 12300148, "まあまあな点数だけど、\n自分的に手ごたえはどう？\nダメだって思ってんなら、\nまだまだ伸びる余地ありね！", 1, 2, 3001, 9, "vo_minigame_1012_result_1080");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (0, 2, 1, 2.21, 5, 8, 12300149, "うん、中々の出来ね！\nでもあんたはもっといい点\n取れるはずよ！\nもっと頑張りましょうか！", 1, 2, 3001, 9, "vo_minigame_1012_result_1081");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (0, 2, 1, 2.46, 5, 3, 12300150, "ん～はっきり言って微妙ね！\nま、難しい問題だし、\n勉強すれば\n点数は上がっていくと思うわ！", 1, 2, 3001, 9, "vo_minigame_1012_result_1082");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (0, 2, 1, 2.94, 5, 3, 12300151, "ん～…\n10点には届かなかったか～\n次は10点越え目指して\n頑張ってみない？", 1, 2, 3001, 9, "vo_minigame_1012_result_1083");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (0, 3, 1, 4.19, 5, 7, 12300152, "はいお疲れ～\n点数的にはまあまあってとこね！\nま、超難問だし頑張ったわよ", 1, 2, 3001, 9, "vo_minigame_1012_result_1084");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (0, 3, 1, 0.0, 5, 1, 12300153, "うん、かなり難しい問題なのに\n最後までやり遂げたわね\n次はもっといい点目指してみる？", 1, 2, 3001, 9, "vo_minigame_1012_result_1085");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (0, 3, 1, 2.63, 5, 3, 12300154, "ちょっとミスが多かったかもね～\nでも間違えた所は復習して\n次は正解するわよー！", 1, 2, 3001, 9, "vo_minigame_1012_result_1086");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (0, 1, 1, 5.53, 1, 3, 12300155, "あら…あんまり良くない点数ね～\nどうしたの、調子でも悪かった？\n次はもっと頑張りましょうか", 1, 2, 3001, 4, "vo_minigame_1012_result_1087");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (9, 1, 3, 0.01, 1, 3, 12300156, "ん～…正解数は\n物足りないわね～\nもうちょっと勉強の時間\n増やしちゃおっか？", 1, 2, 3001, 4, "vo_minigame_1012_result_1088");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3, 1, 1, 4.15, 1, 3, 12300157, "ん～…あんたならもうちょと\nいい点取れんでしょ～？\nもっと頑張んなさいよ\n期待してやってんだからさ！", 1, 2, 3001, 4, "vo_minigame_1012_result_1089");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (9, 2, 9, 0.01, 1, 9, 12300158, "ん～今のあんたには、\nこの問題は難しかったかしら…\n難易度下げてチャレンジするのも\nありかもね～？", 1, 2, 3001, 4, "vo_minigame_1012_result_1090");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (0, 2, 1, 5.37, 1, 3, 12300159, "あんまり出来は良くないわね～\n難しい問題だししょうがないけど\n次はもっと頑張ってほしいわ！", 1, 2, 3001, 4, "vo_minigame_1012_result_1091");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (0, 2, 1, 1.44, 1, 3, 12300160, "なるほど…\nちょっと苦手な問題が多かった？\nもう一度チャレンジ\nしてみましょうか～", 1, 2, 3001, 4, "vo_minigame_1012_result_1092");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (0, 3, 3, 0.0, 1, 3, 12300161, "んん～…問題が難しすぎた？\n無理に難しい問題続けるより、\n難易度下げた方が\n勉強の効率良いかもよ～？", 1, 2, 3001, 4, "vo_minigame_1012_result_1093");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3, 3, 9, 2.91, 1, 3, 12300162, "…あんまり点数取れなかったわね\nこれはあたしにも難しい問題だし\nそう落ち込まなくても大丈夫！\n次頑張りましょ！", 1, 2, 3001, 4, "vo_minigame_1012_result_1094");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (0, 3, 1, 2.61, 1, 5, 12300163, "ごめん、ちょっと難しすぎた？\nもう一度チャレンジするも良し、\n難易度を下げるも良し、\nあんたがやる気なら付き合うわ！", 1, 2, 3001, 4, "vo_minigame_1012_result_1095");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (1, 1, 2, 3.63, 0, 4, 12300164, "ちょっとあんた…\nやる気ないわよね～！？\n次こんな点数取ったら\n怒るわよ！", 1, 2, 3001, 0, "vo_minigame_1012_result_1096");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (1, 1, 2, 4.16, 0, 6, 12300165, "はあ…自分で何点取ったか\n分かってるわよね～…？\n０点よ０点！　舐めてんの！？", 1, 2, 3001, 0, "vo_minigame_1012_result_1097");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (6, 1, 3, 0.01, 0, 3, 12300166, "うう～頭痛い…\nあんたのせいよ！\nなに０点って！\nはあ、このままじゃ赤点よ～…", 1, 2, 3001, 0, "vo_minigame_1012_result_1098");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (0, 2, 2, 5.75, 0, 6, 12300167, "ねえ、あんた本気でやったの？\nまさか適当にやるわけないわよね\n…分かった、\nもう一回チャレンジするのよ！", 1, 2, 3001, 0, "vo_minigame_1012_result_1099");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (1, 2, 2, 5.64, 0, 4, 12300168, "あ…あんた、０点よ０点…！\nあたしの教え方が悪かった…？\n…燃えてきたわ！\n絶対あんたの学力上げてやる！", 1, 2, 3001, 0, "vo_minigame_1012_result_1100");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (8, 2, 4, 5.73, 0, 8, 12300169, "ちょっと待って採点ミスかも…\n…いや合ってるわね。はい０点\n…って０点！？\nふざけんなーー！", 1, 2, 3001, 0, "vo_minigame_1012_result_1101");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (1, 3, 3, 5.32, 0, 5, 12300170, "あらら…０点よ\nま、難しい問題だしね…\n…つっても０点は無いわ！\n一問くらい正解しなさいよ！", 1, 2, 3001, 0, "vo_minigame_1012_result_1102");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (9, 3, 9, 2.37, 0, 3, 12300171, "残念だけど０点よ\nま、まあ前向きにとらえるなら、\n今が底よ！　どん底！\nあとは上がってくだけね！", 1, 2, 3001, 0, "vo_minigame_1012_result_1103");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3, 3, 1, 4.25, 0, 9, 12300172, "…かなり出来が悪いわね\n一旦休憩しましょうか？\nリフレッシュして頭切り替えて\nもう一度頑張りましょう！", 1, 2, 3001, 0, "vo_minigame_1012_result_1104");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (0, 0, 7, 0.0, 0, 7, 13100101, "さ、勉強を始めるわよ", 1, 3, 1001, 0, "vo_minigame_1012_gamestart_100");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (0, 0, 1, 0.0, 0, 1, 13100102, "よし、勉強の成果を見てやるわ！", 1, 3, 1001, 0, "vo_minigame_1012_gamestart_101");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (0, 0, 7, 1.82, 0, 1, 13100103, "じゃあ試験するわよ。はい教科書閉じて！", 1, 3, 1001, 0, "vo_minigame_1012_gamestart_102");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (4, 0, 8, 0.01, 3, 8, 13100201, "やる気マンマンじゃない！", 1, 3, 1002, -1, "vo_minigame_1012_gamestart_103");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (0, 0, 1, 0.0, 3, 1, 13100202, "よし、じゃあもう一回やるわよ！", 1, 3, 1002, -1, "vo_minigame_1012_gamestart_104");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (0, 0, 0, 0.0, 1, 0, 13100301, "普通の難易度よ！", 1, 3, 1003, 1, "vo_minigame_1012_gamestart_105");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (0, 0, 7, 0.0, 1, 7, 13100302, "まずは基本からね！", 1, 3, 1003, 1, "vo_minigame_1012_gamestart_106");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (0, 0, 10, 0.0, 2, 10, 13100303, "難しい問題に挑戦するのね！", 1, 3, 1003, 2, "vo_minigame_1012_gamestart_107");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (0, 0, 8, 0.67, 2, 1, 13100304, "よし、あんたならできるわ！", 1, 3, 1003, 2, "vo_minigame_1012_gamestart_108");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (0, 0, 5, 0.0, 3, 5, 13100305, "あたしでも手こずる難問揃いよ…！", 1, 3, 1003, 3, "vo_minigame_1012_gamestart_109");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (0, 0, 2, 0.0, 3, 2, 13100306, "激ムズだけど頑張んなさい！", 1, 3, 1003, 3, "vo_minigame_1012_gamestart_110");
