INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (0, 0, 3, 0.0, 0, 3, 13100502, "あんたがスズナの\n先生？　…ふーん", 1, 3, 1005, 0, "vo_minigame_1012_gamestart_114");
