INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (0, 2, 3, 2.89, 1, 0, 22300158, "ちょっとずつ覚えれば\nおーけーっしょ！\nうちと一緒に\nベンキョーだね！", 2, 2, 3001, 4, "vo_minigame_1012_result_2090");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (0, 2, 7, 5.45, 1, 0, 22300159, "うちベンキョー苦手でも\nヒデサイとベンキョー\nするのは好き！　だから\nもっかい教えてくれる？", 2, 2, 3001, 4, "vo_minigame_1012_result_2091");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3, 2, 10, 4.29, 1, 4, 22300160, "覚えても、すぐ忘れるんだけど\nどしたらいい？\nあ、そーゆうとき\nフクシューする感じ？", 2, 2, 3001, 4, "vo_minigame_1012_result_2092");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (6, 3, 8, 4.64, 1, 4, 22300161, "ムズ過ぎ！\n頭パンクするかと思った…！\nヒデサイ、うちの頭\nふぅふぅして～", 2, 2, 3001, 4, "vo_minigame_1012_result_2093");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (0, 3, 5, 3.14, 1, 9, 22300162, "おにムズ過ぎてテンサゲ～\nでもヒデサイがんばってるし\nうちもがんばる！", 2, 2, 3001, 4, "vo_minigame_1012_result_2094");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (0, 3, 4, 6.59, 1, 7, 22300163, "ヒデサイと同じ点数で\nちょっち安心したかも\n一緒にがんばろーね！\n置いてっちゃやだよ？", 2, 2, 3001, 4, "vo_minigame_1012_result_2095");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (0, 1, 3, 0.0, 0, 3, 22300164, "…まあ、これより下はないし\n次は大逆転\n点数爆上がりっしょ！", 2, 2, 3001, 0, "vo_minigame_1012_result_2096");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (5, 1, 10, 2.2, 0, 9, 22300165, "０点じゃん…\nそだ、次はえんぴつ転がして\n選ぶ作戦やってみる？", 2, 2, 3001, 0, "vo_minigame_1012_result_2097");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (6, 1, 4, 0.01, 0, 4, 22300166, "考えるの無理な時あるよね…\nヒデサイもそーゆう\n感じだったの？", 2, 2, 3001, 0, "vo_minigame_1012_result_2098");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3, 2, 2, 2.8, 0, 6, 22300167, "え、ヒデサイも０点？\nじゃあうちと一緒じゃん♪\nまあ焦んないで\nベンキョーしてこーよ！", 2, 2, 3001, 0, "vo_minigame_1012_result_2099");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (6, 2, 4, 3.22, 0, 9, 22300168, "むむむ～…０点…！\n覚えてもすぐ忘れちゃうし\nベンキョーってマジ大変", 2, 2, 3001, 0, "vo_minigame_1012_result_2100");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (11, 2, 0, 2.1, 0, 4, 22300169, "０点だね…\nでも、へーきへーき\nリベンジしたら、結果オーライ！", 2, 2, 3001, 0, "vo_minigame_1012_result_2101");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3, 3, 2, 2.74, 0, 0, 22300170, "おやつ休憩して\nリベンジしよっ！\n甘いの食べたら、イケるっしょ！", 2, 2, 3001, 0, "vo_minigame_1012_result_2102");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (9, 3, 9, 3.0, 0, 6, 22300171, "ヒデサイでも\nおにムズな感じ？\nじゃあ、このテスト\n誰も解けなくない？", 2, 2, 3001, 0, "vo_minigame_1012_result_2103");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (0, 3, 2, 4.37, 0, 10, 22300172, "…あれ？\n０が〇に見えてきた！\nきゃはっ、ちょっち\nやる気出てきたかも！", 2, 2, 3001, 0, "vo_minigame_1012_result_2104");
